import React from 'react';
import { Box, Container, Typography, Grid, Paper } from '@mui/material';

const skillCategories = [
  {
    title: 'Languages',
    skills: ['Java', 'Python', 'Golang', 'C', 'C++', 'C#', 'Bash', 'Shell Script', 'Javascript', 'HTML5/CSS3', 'SQL', 'GraphQL', 'Pyspark', 'Scala'],
  },
  {
    title: 'AWS Services',
    skills: ['Elastic Map Reduce (EMR)', 'Lambda', 'API Gateway', 'Security Groups', 'Load Balancers', 'EC2', 'S3', 'IAM', 'DynamoDB', 'SNS/SQS', 'CloudWatch', 'Code Pipeline', 'CloudTrail', 'SSM Parameters', 'KMS', 'Event Bridge', 'Route 53'],
  },
  {
    title: 'Data Analytics & Processing',
    skills: ['Numpy', 'Pandas', 'Sci-Kit Learn', 'MySQL', 'PostgreSQL', 'MongoDB', 'ChromaDB', 'Faiss'],
  },
  {
    title: 'AI & Machine Learning',
    skills: ['Pytorch', 'Tensorflow', 'Langchain', 'Autogen', 'Machine Learning', 'NLP', 'CNN', 'GAN', 'RNN', 'LSTM', 'LLM'],
  },
  {
    title: 'Frameworks',
    skills: ['SpringBoot', 'Django', 'Flask', 'Flutter', 'ReactJS', 'Android Java', 'FastAPI'],
  },
  {
    title: 'Tools & Technologies',
    skills: ['Terraform', 'Docker', 'Kubernetes', 'Kafka', 'RabbitMQ', 'Maven', 'Splunk', 'Git', 'BitBucket', 'Jenkins', 'Kanban', 'JIRA', 'Grafana', 'RESTful APIs', 'CI/CD'],
  },
];

const Skills = () => (
  <Box id="skills" sx={{ py: 10, bgcolor: 'background.default' }}>
    <Container maxWidth="lg">
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', mb: 2 }}>
        <Box>
          <Typography variant="body1" sx={{ color: '#555', fontWeight: 500, textAlign: 'right' }}>
            Explore My
          </Typography>
          <Typography variant="h2" sx={{ fontWeight: 700, textAlign: 'right', fontSize: 36 }}>
            Skills
          </Typography>
        </Box>
      </Box>
      <Paper
        sx={{
          borderRadius: 6,
          border: '2px solid #e0e0e0',
          p: { xs: 2, md: 6 },
          boxShadow: 'none',
          background: '#fff',
        }}
      >
        <Grid container spacing={4}>
          {skillCategories.map((category, index) => (
            <Grid item xs={12} key={index}>
              <Typography variant="h5" sx={{ fontWeight: 700, mb: 1, color: '#222' }}>
                {category.title}
              </Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1.5, mb: 2 }}>
                {category.skills.map((skill, idx) => (
                  <Box
                    key={idx}
                    sx={{
                      px: 2.5,
                      py: 1,
                      borderRadius: 999,
                      background: '#fafbfc',
                      color: '#222',
                      fontWeight: 500,
                      fontSize: 16,
                      border: '1px solid #e0e0e0',
                    }}
                  >
                    {skill}
                  </Box>
                ))}
              </Box>
            </Grid>
          ))}
        </Grid>
      </Paper>
    </Container>
  </Box>
);

export default Skills;
